import React from "react";
import gif from "../../assets/home/gif.png";

import "./Home.css";

const Home = () => {
  return (
    <div>
      <img src={gif} className="gif" />
      <img src="https://via.placeholder.com/1420x616" width={'100%'}/>
    </div>
  );
};

export default Home;
